script: |
  super -f text -I q10368.spq | sort > q10368.out

inputs:
  - name: q10368.spq
    data: |
      SELECT DISTINCT col0 * 11, - col1 - 31 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE col2 / col0 / + - col0 NOT IN ( + col1 );
  - name: tab1

outputs:
  - name: q10368.out
    data: |
      1001	-78
      561	-45
      935	-36
